localStorage.setItem('imgLeft', 'data:png;base64,')

// Mostrar los datos en la Tabla
function agregar() {
    const nivel = document.getElementById('nivel')?.value.toUpperCase();
    const grado = document.getElementById('grado')?.value.toUpperCase();
    const ie = document.getElementById('ie')?.value;
    const dni = document.getElementById('dni')?.value;
    const estudiante = document.getElementById('estudiante')?.value.toUpperCase();
    const apoderado = document.getElementById('apoderado')?.value.toUpperCase();
    const iedestino = document.getElementById('iedestino')?.value.toUpperCase();
    const codmod = document.getElementById('codmod')?.value;

    if (dni && nivel && grado && estudiante && apoderado && iedestino) {
        if(dni.length === 8){
            const tableBody = document.querySelector('table tbody');
            const newRow = document.createElement('tr');
        
            newRow.innerHTML = `
                <td>${dni}</td>
                <td>${estudiante}</td>
                <td>${apoderado}</td>
                <td>${grado}</td>
                <td>${iedestino}</td>
            `;

            newRow.setAttribute('data-nivel', nivel);
            newRow.setAttribute('data-ie', ie);
            newRow.setAttribute('data-codmod', codmod); 
            
            tableBody.appendChild(newRow);

            // Guardar datos en Cache
            guardarDatosEnLocalStorage();

            // Limpiar Inputs
            document.getElementById('dni').value = '';
            document.getElementById('estudiante').value = '';
            document.getElementById('ie').value = '';
            document.getElementById('apoderado').value = '';
            document.getElementById('grado').value = '';
            document.getElementById('iedestino').value = '';
            document.getElementById('nivel').value = '';
            document.getElementById('codmod').value = '';
        }else{
            alert('El DNI debe tener al menos 8 dgitos.')
        }
    }else{
        alert('Faltan Campos por Completar!');
    }
}

// Cargar datos de la tabla guardados en cache
function cargarDatosDesdeLocalStorage() {
    const datosGuardados = localStorage.getItem('datosTabla');
    if (datosGuardados) {
        const tableBody = document.querySelector('table tbody');
        tableBody.innerHTML = datosGuardados;
    }
}

// Generar y descargar el PDF
